var app = angular.module('myApp', []);
app.controller('certCtrl', function ($scope) {
    $scope.student = {};
    $scope.cert = false;
    $scope.passcert = false;
    $scope.countmsg = "";
    $scope.evaluatemsg = "";


    $scope.storageRef = firebase.storage();


    $scope.genCert = function (tmp) {
        console.log(tmp);
        $scope.filename = tmp.mobile + Date.now();
        $scope.stuname = tmp.name;
        var docDefinition = {
            pageSize: "A4",
            pageOrientation: "landscape",
            pageMargins: [10, 10, 10, 10],

            background: [{
                image: "data:image/jpeg;base64,",
                width: 845,
                height: 585
            }],
            defaultStyle: {
                font: "RSU"
            },
            content: [{
                margin: [0, 240],
                table: {
                    widths: ["*"],

                    body: [
                        [{
                            border: [false, false, false, false],
                            text: tmp.name,
                            fontSize: 28,
                            bold: true,
                            alignment: "center"
                        }]
                    ]
                }
            }]
        };
        pdfMake.fonts = {
            Roboto: {
                normal: "Roboto-Regular.ttf",
                bold: "Roboto-Medium.ttf",
                italics: "Roboto-Italic.ttf",
                bolditalics: "Roboto-MediumItalic.ttf"
            },
            THSarabunNew: {
                normal: "THSarabunNew.ttf",
                bold: "THSarabunNew Bold.ttf",
                italics: "THSarabunNew Italic.ttf",
                bolditalics: "THSarabunNew BoldItalic.ttf"
            },
            RSU: {
                normal: "RSU_Regular.ttf",
                bold: "RSU_BOLD.ttf",
                italics: "RSU_light.ttf"
            }
        };
        // pdfMake.createPdf(docDefinition).print({}, window);



        const pdfDocGenerator = pdfMake.createPdf(docDefinition);

        pdfDocGenerator.getDataUrl((dataUrl) => {

            // liff.openWindow({
            //     url: dataUrl,
            //     external: true
            // });
            // $scope.certimg = dataUrl;
            // console.log(dataUrl);
            // $scope.$apply();
            storageRef = $scope.storageRef;



            var uploadTask = storageRef.ref().child("images/" + $scope.filename + ".jpg").putString(dataUrl, 'data_url');


            // Register three observers:
            // 1. 'state_changed' observer, called any time the state changes
            // 2. Error observer, called on failure
            // 3. Completion observer, called on successful completion
            uploadTask.on('state_changed', function (snapshot) {
                // Observe state change events such as progress, pause, and resume
                // Get task progress, including the number of bytes uploaded and the total number of bytes to be uploaded
                var progress = (snapshot.bytesTransferred / snapshot.totalBytes) * 100;
                console.log('Upload is ' + progress + '% done');
                switch (snapshot.state) {
                    case firebase.storage.TaskState.PAUSED: // or 'paused'
                        console.log('Upload is paused');
                        break;
                    case firebase.storage.TaskState.RUNNING: // or 'running'
                        console.log('Upload is running');
                        break;
                }
            }, function (error) {
                // Handle unsuccessful uploads
            }, function () {
                // Handle successful uploads on complete
                // For instance, get the download URL: https://firebasestorage.googleapis.com/...
                uploadTask.snapshot.ref.getDownloadURL().then(function (downloadURL) {
                    console.log('File available at', downloadURL);

                    // liff.openWindow({
                    //     url: "downloadURL",
                    //     external: true
                    // });
                    $scope.updateCert($scope.profile, downloadURL);
                    liff.sendMessages([

                        {
                            "type": "flex",
                            "altText": "This is a Flex Message",
                            "contents": {
                                "type": "bubble",
                                "direction": "ltr",
                                "header": {
                                    "type": "box",
                                    "layout": "vertical",
                                    "contents": [{
                                        "type": "text",
                                        "text": "e-Certificate",
                                        "weight": "bold",
                                        "align": "center",
                                        "contents": []
                                    }]
                                },
                                "hero": {
                                    "type": "image",
                                    "url": "https://www.appstudio.space/cothopenhouse/certificate.jpg",
                                    "size": "full",
                                    "aspectRatio": "1.51:1",
                                    "aspectMode": "fit"
                                },
                                "body": {
                                    "type": "box",
                                    "layout": "vertical",
                                    "contents": [{
                                        "type": "text",
                                        "text": $scope.stuname,
                                        "align": "center",
                                        "contents": []
                                    }]
                                },
                                "footer": {
                                    "type": "box",
                                    "layout": "horizontal",
                                    "contents": [{
                                        "type": "button",
                                        "action": {
                                            "type": "uri",
                                            "label": "Download",
                                            "uri": downloadURL
                                        },
                                        "color": "#055E00FF",
                                        "style": "primary"
                                    }]
                                }
                            }
                        }



                    ]).then(function () {
                        // window.alert('Message sent');

                        liff.closeWindow();
                    }).catch(function (error) {
                        window.alert('Error sending message: ' + error);
                    });
                });
            });


        });



    };


    $scope.requestCert = function (student) {

        liff.sendMessages([

            {
                "type": "flex",
                "altText": "This is a Flex Message",
                "contents": {
                    "type": "bubble",
                    "direction": "ltr",
                    "header": {
                        "type": "box",
                        "layout": "vertical",
                        "contents": [{
                            "type": "text",
                            "text": "e-Certificate",
                            "weight": "bold",
                            "align": "center",
                            "contents": []
                        }]
                    },
                    "hero": {
                        "type": "image",
                        "url": "https://www.appstudio.space/cothopenhouse/certificate.jpg",
                        "size": "full",
                        "aspectRatio": "1.51:1",
                        "aspectMode": "fit"
                    },
                    "body": {
                        "type": "box",
                        "layout": "vertical",
                        "contents": [{
                            "type": "text",
                            "text": student.name,
                            "align": "center",
                            "contents": []
                        }]
                    },
                    "footer": {
                        "type": "box",
                        "layout": "horizontal",
                        "contents": [{
                            "type": "button",
                            "action": {
                                "type": "uri",
                                "label": "Download",
                                "uri": student.certURL
                            },
                            "color": "#055E00FF",
                            "style": "primary"
                        }]
                    }
                }
            }



        ]).then(function () {
            // window.alert('Message sent');

            liff.closeWindow();
        }).catch(function (error) {
            window.alert('Error sending message: ' + error);
        });

    };



    $scope.updateCert = function (profile, url) {

        console.log($scope.student.certificate);
        $scope.student.certificate = true;
        $scope.student.certURL = url;

        db.collection("students").doc(profile.userId).set($scope.student)
            .then(function () {
                // alert("ข้อมูลถูกบันทึกแล้ว");

                console.log("Document successfully written!");
            })
            .catch(function (error) {
                alert(error);
                console.error("Error writing document: ", error);
            });

    };





    $scope.getStudent = function (profile) {

        var docRef = db.collection("students").doc(profile.userId);


        docRef.onSnapshot(function (doc) {
            if (doc.exists) {
                console.log("Current data: ", doc.data());
                $scope.student = doc.data();

                console.log($scope.student.stations);
                var count = 0;
                for (i = 0; i < 18; i++) {
                    if ($scope.student.stations[i].scan == true) {
                        count++;
                    }
                }
                if (count < 10) {
                    $scope.countmsg = "คุณยังเข้าร่วมกิจกรรมไม่ครบ";
                    $scope.cert = false;
                } else {
                    $scope.countmsg = "คุณเข้าร่วมกิจกรรมครบแล้ว";
                    $scope.cert = true;
                }
                if ($scope.student.stations[18].scan == false) {
                    $scope.evaluatemsg = "คุณยังไม่ได้ประเมินกิจกรรม";
                    $scope.cert = false;
                } else {
                    $scope.evaluatemsg = "คุณเข้าทำการประเมินแล้ว";
                    $scope.cert = true;
                }

                // console.log(count);
                // console.log($scope.student.stations[21].scan);
                // if ($scope.student.stations[21].scan == true && count >= 6) {
                //     $scope.cert = true;
                // }
                console.log($scope.cert);
                if ($scope.student.certificate == true) {
                    $scope.passcert = true;
                }
                console.log($scope.student.certificate);


                $scope.$apply();
            } else {
                // doc.data() will be undefined in this case
                alert("กรุณาบันทึกข้อมูลส่วนตัวก่อน");
                console.log("No such document!");
            }
        });


    };




    $scope.initLIFF = function () {
        function runApp() {
            liff.getProfile().then(profile => {
                $scope.profile = profile;
                console.log(liff.getDecodedIDToken());
                $scope.getStudent(profile);
                console.log(profile);
            }).catch(err => console.error(err));
        }
        liff.init({
            liffId: "1654998118-AY605kEj"
        }, () => {

            if (liff.isLoggedIn()) {
                runApp()
            } else {
                liff.login();
            }
        }, err => console.error(err.code, error.message));
    };


});